module.exports = "<p>\r\n    <br /><h1> Search Meetings </h1>\r\n  <p>\r\n\r\n  <p>\r\n    After the meeting information is in a relational database, it can be used in many ways.\r\n  </p>\r\n\r\n  <h3> Search for information </h3>\r\n  <p></p>\r\n  <ul>\r\n    <li> Search all past meetings for discussion on a specific issues. </li>\r\n    <li> Search for everthing that a specific official said on an issue. </li>\r\n    <li> Search for when specific bills were either discussed or acted upon. </li>\r\n    <li> Search for anything on a specific type of issue (public safety, zoning, etc) </li>\r\n  </ul>\r\n\r\n  <h3> Browse information </h3>\r\n  <p>  </p>\r\n  <ul>\r\n    <li> Browse all topics discussed in the past year. </li>\r\n    <li> See which officials attended each of the past meetings. </li>\r\n    <li> See what legislation was voted on and what the votes were. </li>\r\n    <li> Browse all public commentary on specific issues. </li>\r\n  </ul>\r\n\r\n  <h3> Sign up for email or text alerts </h3>\r\n  <ul>\r\n    <li>  when any specific issue is discussed at a meeting. </li>\r\n    <li>  when a there is discussion in any category of issues (Recreation, Zoning, Animal Control, etc). </li>\r\n    <li>  when any new legislature is proposed. </li>\r\n    <li>  whenever any search criteria that you set up returns results in the future. </li>\r\n  </ul>\r\n\r\n  <h3> Comparisons with other communities </h3>\r\n  <p>  </p>\r\n  <ul>\r\n    <li> Compare types of issues that are discussed. </li>\r\n    <li> Compare how similar issues are handled. </li>\r\n    <li> Compare meeting structures and time allotment. </li>\r\n    <li> Compare procedures for public comment.  </li>\r\n  </ul>\r\n\r\n\r\n"

