module.exports = "<!-- <mat-card>\r\n  <mat-card-content [style.overflow]=\"'auto'\" [style.height.px]=\"'300'\">\r\n --><h1> Future Volunteer Page </h1>\r\n<p>\r\nThis will be a page where volunteers can collaborate. The default content displayed will be related to their own home community\r\nand the status of their contributions.\r\nThey can also browse content related to other communities. The page will include these elements:\r\n</p>\r\n<h3> List of current and past meetings and their status. </h3>\r\n<p>\r\nThis will show a listing of present and past meetings. It will show which have been processed and which still require work.\r\nIf the user selects a meeting, either the \"Work in Progres\" or \"Completed\" details components below will be shown.\r\n</p>\r\n\r\n<h3> Work in Progress </h3>\r\n<p>\r\nThis will show the current state of progress on this meeting.\r\nIf this meeting involves a recording, it will display a list of all the pieces that the recording was split into.\r\nIt will show which pieces are (1) completed, (2) in progress and (3) not started.\r\nThe volunteer can choose a piece of the recording to work on.\r\n</p>\r\n<p>\r\nOnce someone start to process a piece, it is assigned to them until they either mark it completed or some (to be determined) time span elapses. <br />\r\nThe volunteer can also choose to work on adding tags to a transcript that is ready for this step.\r\nIn this case, the transcript will be assigned to them, until it is completed or after some time lapse.\r\n</p>\r\n<h3> Completed </h3>\r\n\r\nThis will show statistics on work that was completed: Number of volunteer contributing, time to complete, etc.\r\n\r\n<h3> Volunteer chat box </h3>\r\n<p>\r\nVolunteer who are logged in can chat among themselves. They can select to filter the chat room to see just those in thier own community,\r\ntheir own county, their own state, their own country or leave it open to everyone.\r\n</p>\r\n<!-- </mat-card-content>\r\n</mat-card>\r\n -->\r\n\r\n"

